// Define static frame count constants
const int AnimationGame::GHOST_FRAME_COUNT = sizeof(ghost_frames)/sizeof(ghost_frames[0]);
const int AnimationGame::COOL_FRAME_COUNT = sizeof(cool_frames)/sizeof(cool_frames[0]);
const int AnimationGame::ROCKET_FRAME_COUNT = sizeof(rocket_frames)/sizeof(rocket_frames[0]);

AnimationGame::AnimationGame(Adafruit_SH1106G* disp) : display(disp), currentAnimation(0), frame(0), lastSwitchTime(0) {}

void AnimationGame::init() {
    currentAnimation = 0;
    frame = 0;
    lastSwitchTime = millis();
}

void AnimationGame::update() {
    unsigned long currentTime = millis();
    
    // Check if it's time to switch animation
    if (currentTime - lastSwitchTime >= ANIMATION_SWITCH_DELAY) {
        currentAnimation = (currentAnimation + 1) % 3;
        frame = 0;
        lastSwitchTime = currentTime;
    }
}

void AnimationGame::draw() {
    display->clearDisplay();
    
    switch (currentAnimation) {
        case 0: // Ghost
            display->drawBitmap(40, 8, ghost_frames[frame], GHOST_WIDTH, GHOST_HEIGHT, 1);
            frame = (frame + 1) % GHOST_FRAME_COUNT;
            break;

        case 1: // Cool
            display->drawBitmap(32, 0, cool_frames[frame], COOL_WIDTH, COOL_HEIGHT, 1);
            frame = (frame + 1) % COOL_FRAME_COUNT;
            break;

        case 2: // Rocket
            display->drawBitmap(32, 0, rocket_frames[frame], ROCKET_WIDTH, ROCKET_HEIGHT, 1);
            frame = (frame + 1) % ROCKET_FRAME_COUNT;
            break;
    }
    
    display->display();
    delay(FRAME_DELAY);
}